import { Route, Routes } from 'react-router-dom';
import './Grid.css';
import Menu from './Menu';
import Inicio from './pages/Inicio';
function Grid()
{
    return(
        <>
        <div className="grid-Layout">
        <div class="caja1">Cabecera</div>
        <div class="caja2">
            <Routes>
                <Route path='.pages/Inicio.js' element={<Inicio></Inicio>}></Route>
            </Routes>
        </div>
        <div class="caja3">Lateral</div>
        <div class="caja4">Footer</div>
        <div class="caja5"><Menu></Menu></div>
        </div>
        </>
    )
}
export default Grid;
